result:
  query ($slug: String!) {
    strapi {
      articles(where: { slug: $slug }) {
        slug
        title
        content
        publishedAt
        image {
          url
        }
        Seo {
          metaTitle
          metaDescription
          shareImage {
            image {
              url
            }
          }
        }
        user {
          username
          image {
            url
          }
        }
      }
	  }
  }
